import './style.css'
import { Form, FormGroup, Label, Input, Button } from 'reactstrap';

const form = () => {

  return (

    <div className="wrapper">
      <div className="form-signin">
        <Input
          size="50px"
          bsSize="lg"
          // className="mb-3"
          type="select"
        >
          <option>
            New South Wales
          </option>
          <option>
            Queensland
          </option>
          <option>
            South Australia
          </option>
          <option>
            Victoria
          </option>
          <option>
            Western Australia
          </option>
        </Input>

        <Input
          // onChange={() => handleChange(event)}
          // value={product.price}
          type="text"
          //className="form-control"
          name="price"
          placeholder="price"
        />
        <Input
          // onChange={() => handleChange(event)}
          // value={product.description}
          type="text"
          // className="form-control"
          name="description"
          placeholder="description"
        />
        <button
          className="btn btn-lg btn-primary btn-block"
        // onClick={() => handleSubmit()}
        >
          Submit
        </button>
      </div>
    </div>
  )
}
export default form
